import logo from './logo.svg';
import './App.css';


function App() {
  const styles = { 
    backgroundColor: "#F5F5F5",
  }
  const btn = {
    color: "white",
    backgroundColor: "#7090B0",
    cursor:"hand",
  	padding: "5px",
  	borderRadius: "2em",
  }
  return (
    <div className="App">
      <div style={styles}>
        <header>
          <nav>
            <a href='#'> Contact </a>
            <button style ={btn}>Login</button>
            <a href='#'> Profile </a>
          </nav>
        </header>
      </div>
    </div>
  );
}

export default App;
